import React from "react";

const MapView = ({ data }) => {
    return (
      <div className="row">

        {data.map((row, i)=>(
             <div className="col s12 m3 l6 card horizontal box" key={i}>
                 {row.location.longitude}
                 {row.location.latitude}
             </div>
          ))} 


      </div>
    );
  };

  export default MapView;
